AttributeContainer.prototype.getAttributeAt = function(index)
{
    var count = 0;
    for (var i in this.attrNameMap)
    {
        for (var j=0; j < this.attrNameMap[i].length; j++)
        {
            if (count == index)
            {
                return this.attrNameMap[i][j];
            }
            count++;
        }
    }
    
    return null;
}

