{
    var count = 0;
    for (var i in this.attrNameMap)
    {
        for (var j=0; j < this.attrNameMap[i].length; j++)
        {
            if (this.attrNameMap[i][j] == attribute)
            {
                return i;
            }
            count++;
        }
    }

    return null;
}

