LWSceneBuilder.prototype.handleToken = function(token, params)
{
    switch (token)
    {
        case "LWSC":
            this.handleSceneToken(params);
            break;
            
        case "LWMO":
            this.handleMotionToken(params);
            break;
            
        default:
            this.handleCommandToken(token, params);
            break;
    }
}

